<!doctype html>
<html lang="en">
  <head>
    <meta charset="UTF-8">
    <style>
      html, body {
        padding: 0;
        margin: 0;
        height: 100%;
        border: none;
        -webkit-text-size-adjust: 100%;
        font-family: Helvetica, sans-serif;
      }
      
      #loading {
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        width: 100%;
        height: 100%;
        display: -webkit-box;
        display: -ms-flexbox;
        display: flex;
        -webkit-box-pack: center;
        -ms-flex-pack: center;
        justify-content: center;
      }
      
      .wrapper {
        position: relative;
        top: 20%;
        width: 10vw;
        height: 10vw;
        display: -webkit-box;
        display: -ms-flexbox;
        display: flex;
        -webkit-box-orient: vertical;
        -webkit-box-direction: normal;
        -ms-flex-direction: column;
        flex-direction: column;
        -webkit-box-align: center;
        -ms-flex-align: center;
        align-items: center;
      }
      
      .logo > svg {
        width: 100%;
        height: 100%;
      }
      
      #stage {
        font-size: 16px;
        margin-top: 20px;
      }
    </style>

 `data` – transform input data for the view and its nested views\n- `whenData` – control view rendering after an input data is transformed\n- `className` – add class name(s) to the root element of view if any\n- `postRender` - a function which should be invoked after view rendering but before placing to destination place in DOM\n- `tooltip` – setup a tooltip to show on view hovering, can be applied for views with a container only\n\nThe order of evaluation during a view render:\n\n```js\n                          input data | output data (the result of \"data\" evaluation if any)\n                                     |\nrender start ---\x3e [when] --\x3e [data] -|-> [whenData] --\x3e [postRender] --\x3e [className] --\x3e render finish\n                                     |\n```\n\nWhen `data` property is specified, it changes flow's data according the following rules:\n\n- a string – treated as a query which result is used as the output data\n- a function like `fn(data, context)` – the result of the function invocation is used as the output data\n- any other value used as the output data\n\n> Note: Only `when` and `data` properties get an input data, any other functions and queries receive\na result of `data` property evalution. When `data` is not specified all the queries and functions\nreceive the same input data.\n\nProperties `when` and `whenData` can take:\n\n- a string – treated as a query\n- `true` – treated as a empty query which mean that the data itself is examinated with no any transformation\n- `undefined` – same when not specified, just render (ignore the property)\n- a function like `fn(data, context)`\n- any other value used as is\n\nRegardless of how the value is obtained, it is coerce to a boolean.\nPlase note, that Jora rules are used which mean that empty arrays and object with no own keys are falsy (truthy in JavaScript).\nThe view is only rendered if the resulting value is truthy.\n\n## Queries for properties\n\nIn some cases, it is necessary to compute the value of a property based on the data.\nTo do this, you can use a string value for a property that starts with `=`.\nThis will mean that everything after the `=` is a query which will take output data and produce a value for the property.\nOther values are passed to the view render as is, without any changes.\n\nIn the following, limit number of items rendered at once only if there are more than 12 items:\n\n```discovery-view\n{\n    view: 'list',\n    limit: '=size() <= 12 and 10'  // the same as '=size() <= 12 ? false : 10'\n}\n```\n\n> Note: In those rare cases when you need to pass to a property a string that starts with `=`,\nyou can use a query like `=\"=some string\"`,<br>e.g. `{ view: 'example', prop: '=\"=string=\"' }`\n\n## Shorthand notations\n\n| Shorhand notation | Expands into ... |\n| --- | --- |\n| `'name'` | `{ view: 'name' }`\n| `'name:<query>'` | `{ view: 'name', data: '<query>' }`\n| `'name{ foo: size() / 2, bar: \"qux\" }'` | `{ view: 'name', foo: '=size() / 2', bar: 'qux' }`\n\n## List of views\n\nIf you need to specify a list of views, then you must use an array.\nAn array with view definitions can be passed anywhere a view is accepted as a value.\n\n```discovery-view\n[\n    {\n        view: 'list',\n        item: [\n            'text:name',\n            { view: 'badge', data: 'something.size()' }\n        ]\n    },\n    'table{ limit: 10 }'\n]\n```\n\n## Tooltip\n\nA canonical form for a toolup setup is an object with fields (all are optional):\n\n```js\n{\n    className: 'string',\n    position: 'trigger', // 'trigger' or 'pointer' (default)\n    content: 'a view setup'\n}\n```\n\nInstead of such object, any view notation can be used, i.e. a string, an object with `view` property, an array or a function:\n\n| Shorhand notation | Expands into ... |\n| --- | --- |\n| `'name'` | `{ content: 'name' }`\n| `{ view: 'name' }` | `{ content: { view: 'name' } }`\n| `['view', { view: 'name' }]` | `{ content: ['view', { view: 'name' }] }`\n\nA content is rendering into a popup container. When `className` is used it behaves the same as for a view but applies to a popup container.\n";function Ao(e){e.page.define("views-showcase",{view:"context",data:()=>[...e.view.values],modifiers:[{view:"block",className:"sidebar",content:{view:"content-filter",content:{view:"menu",name:"view",limit:!1,data:"\n                            .[name ~= #.filter]\n                            .sort(name asc)\n                            .({ ..., disabled: no options.usage })\n                        ",item:"text-match:{ text: name, match: #.filter }"}}}],content:{view:"block",className:"content",data:"$[=> name=(#.view.name or #.id)]",content:{view:"switch",content:[{when:"no $ and #.id",content:'alert-warning:"View \\"" + #.id + "\\" not found"'},{when:"no $",content:['h1:"Views showcase"','alert:"← Select a view to get details"',{view:"markdown",source:Co}]},{content:[{view:"context",postRender:function(t,n,i,r){e.setPageRef(i.name),e.cancelScheduledRender(),r.id=e.pageRef}},wo(e)]}]}}},{sidebar:!1})}function So(e,t){let n=le("style",null,":host{display:none}"),i=new Set,r=Promise.resolve();return Array.isArray(t)&&(e.append(...t.map((e=>{switch("string"==typeof e&&(e={type:"style",content:e}),e.type){case"style":case"inline":return le("style",{media:e.media},e.content);case"link":case"external":{let t,r,o=new Promise(((e,n)=>{t=e,r=n}));return i.add(o),le("link",{rel:"stylesheet",href:e.href,media:e.media,onerror(e){i.delete(o),r(e),i.size||n.remove()},onload(){i.delete(o),t(),i.size||n.remove()}})}default:throw new Error(`Unknown type "${e.type}" for a style descriptor`)}}))),i.size&&(r=Promise.all(i),e.append(n))),r}var To=0,Do=[{view:"badge",when:'view.data != parent.(view or viewRoot).data or "data" in view.config',data:{text:"D"},tooltip:'text:"Data value was changed"'},{view:"badge",when:"view.context != parent.(view or viewRoot).context",data:{text:"C"},tooltip:'text:"Context value was changed"'}];function Lo(e,     <script>
      setStage('Parsing', () => {
        for (const element of document.querySelectorAll('script')) {
          if(element.dataset.id) {
            jsonExtAPIName.pushChunk(element.dataset.id, element.innerText);
            // cleanup script-tags to free memory
            element.remove();
          }
        }
        
        const initFunction = function (data) {
            Statoscope.default(data.map((item) => ({ name: item.id, data: item.data })));
          };
        
        jsonExtAPIName.parse()
          .then(items => {
            setStage('Initialization', () => {
              initFunction(items);
              document.querySelector('#loading').remove();
            });
          });
      })
    </script>
  </body>
